import React from "react";
import Header from "./ReusableComponents/Header";
import Footer from "./ReusableComponents/Footer";
import Grid from "@mui/material/Grid";
import Box from "@mui/material/Box";
import TextField from "@mui/material/TextField";
import Checkbox from "@mui/material/Checkbox";
import InputLabel from "@mui/material/InputLabel";
import MenuItem from "@mui/material/MenuItem";
import FormControl from "@mui/material/FormControl";
import Select from "@mui/material/Select";
import OutlinedInput from "@mui/material/OutlinedInput";

const label = { inputProps: { "aria-label": "Checkbox demo" } };
const ITEM_HEIGHT = 48;
const ITEM_PADDING_TOP = 8;
const MenuProps = {
  PaperProps: {
    style: {
      maxHeight: ITEM_HEIGHT * 4.5 + ITEM_PADDING_TOP,
      width: 250,
    },
  },
};

const names = [
  "Oliver Hansen",
  "Van Henry",
  "April Tucker",
  "Ralph Hubbard",
  "Omar Alexander",
  "Carlos Abbott",
  "Miriam Wagner",
  "Bradley Wilkerson",
  "Virginia Andrews",
  "Kelly Snyder",
];

function getStyles(name, personName, theme) {
  return {
    fontWeight:
      personName.indexOf(name) === -1
        ? theme.typography.fontWeightRegular
        : theme.typography.fontWeightMedium,
  };
}

const Volunteer = () => {
  const theme = useTheme();
  const [personName, setPersonName] = React.useState([]);

  const handleChange = (event) => {
    const {
      target: { value },
    } = event;
    setPersonName(
      // On autofill we get a stringified value.
      typeof value === "string" ? value.split(",") : value
    );
  };
  return (
    <div>
      <Header />
      <Grid container spacing={2} className="choice1">
        <Grid item xs={8} style={{ padding: "30px", margin: "40px" }}>
          <div
            style={{
              marginBottom: "2px",
              backgroundColor: "#e5e5e5",
              padding: "10px 20px",
            }}
          >
            <h1 style={{ color: "#4c4f4d" }}>Volunteer Form</h1>
          </div>
          <div style={{ backgroundColor: "#e5e5e5", padding: "20px" }}>
            <Grid container spacing={2} className="choice1">
              <Grid item xs={4}>
                <Box sx={{ maxWidth: "100%" }}>
                  <FormControl sx={{ m: 1, width: 300, mt: 3 }}>
                    <Select
                      multiple
                      displayEmpty
                      value={personName}
                      onChange={handleChange}
                      input={<OutlinedInput />}
                      renderValue={(selected) => {
                        if (selected.length === 0) {
                          return <em>State</em>;
                        }

                        return selected.join(", ");
                      }}
                      MenuProps={MenuProps}
                      inputProps={{ "aria-label": "Without label" }}
                    >
                      <MenuItem disabled value="">
                        <em>State</em>
                      </MenuItem>
                      {names.map((name) => (
                        <MenuItem
                          key={name}
                          value={name}
                          style={getStyles(name, personName, theme)}
                        >
                          {name}
                        </MenuItem>
                      ))}
                    </Select>
                  </FormControl>
                </Box>
              </Grid>

              <Grid item xs={4}>
                <Box sx={{ maxWidth: "100%" }}>
                  <TextField fullWidth label="Email ID*" id="fullWidth" />
                </Box>
              </Grid>

              <Grid item xs={4}>
                <Box sx={{ maxWidth: "100%" }}>
                  <TextField fullWidth label="Phone No.*" id="fullWidth" />
                </Box>
              </Grid>
            </Grid>
            <div className="choice1" style={{ justifyContent: "left" }}>
              <Checkbox {...label} defaultChecked />
              <p>
                Subscribe for WhatsApp updates of plantation events. (To avail
                this, WhatsApp number is mandatory)
              </p>
            </div>

            <div className="choice1" style={{ justifyContent: "left" }}>
              <Checkbox {...label} defaultChecked />
              <p>Subscribe to our Monthly Newsletter</p>
            </div>
            <TextField
              fullWidth
              label="Address"
              multiline
              rows={4}
              style={{ marginBottom: "20px" }}
            />

            <Grid container spacing={2} className="choice1">
              <Grid item xs={4}>
                <Box sx={{ minWidth: 120 }}>
                  <FormControl fullWidth>
                    <InputLabel id="demo-simple-select-label">Age</InputLabel>
                    <Select
                      labelId="demo-simple-select-label"
                      id="demo-simple-select"
                      value={age}
                      label="Age"
                      onChange={handleChange}
                    >
                      <MenuItem value={10}>Ten</MenuItem>
                      <MenuItem value={20}>Twenty</MenuItem>
                      <MenuItem value={30}>Thirty</MenuItem>
                    </Select>
                  </FormControl>
                </Box>
              </Grid>

              <Grid item xs={4}>
                <Box sx={{ maxWidth: "100%" }}>
                  <TextField fullWidth label="City" id="fullWidth" />
                </Box>
              </Grid>

              <Grid item xs={4}>
                <Box sx={{ maxWidth: "100%" }}>
                  <TextField fullWidth label="Phone No.*" id="fullWidth" />
                </Box>
              </Grid>
            </Grid>
          </div>
        </Grid>
      </Grid>
      <Footer />
    </div>
  );
};

export default Volunteer;
